  componentDidUpdate(prevProps) {
    if (this.props.cars !== prevProps.cars) {
      console.log('didUpdate', this.props.cars)
      this.setState({
        lol: this.props.cars[0].make
      })
    }
  }



  render() {

    console.log('render')

    return (
      <div>

        <p>working</p>
        <p>{this.props.cars.map(map => {
          return map.make
        })}</p>


      </div>
    )
  }
}

const mapStateToProps = (state) => ({
  cars: state.cars
});

export default connect(mapStateToProps,
  { getCars })(App)
